import React from 'react';
import logo from './img/logo3.png';

const Optowelt = () => {
    return (
        <div>
            <img src={logo}  style={{ width:1365, height: 480 }} alt={"logo"}/> 
           <h1> Optowelt</h1>
        </div>
    );
};

export default Optowelt;
